import React from 'react'
import Popup from 'reactjs-popup'

function PopUp() {
    return (
        <div>
            <Popup trigger={<button>Trigger</button>}>
            <div>Popup content here !!</div>
            </Popup>
        </div>
    )
}

export default PopUp
